(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-9eb30cda"],{"036c":function(e,o,a){var t=a("18c7"),s=a("4238"),r=a("a90f"),n=s("species");e.exports=function(e){return r>=51||!t((function(){var o=[],a=o.constructor={};return a[n]=function(){return{foo:1}},1!==o[e](Boolean).foo}))}},"0778":function(e,o,a){e.exports=a.p+"static/img/detail03.0e7b6453.png"},"0c29":function(e,o,a){"use strict";a.d(o,"b",(function(){return t})),a.d(o,"a",(function(){return s}));a("47b0");function t(){return[{title:'Faça parte da "Energia Compartilhada" e adquira chances de aumentar os seus ganhos',img:a("71e5"),time:"29.3.2021",id:"1",content:'\n                <h4 class="title">Faça parte da "Energia Compartilhada" e adquira chances de aumentar os seus ganhos</h4>\n                <p>Viemos desenvolvendo drasticamente o projeto da Economia Colaborativa e Energia Renovável  em diversos países e territórios por dois anos. </p>\n                <p>Além de trazer conveniência para a vida de muitas pessoas,  a Energia Compartilhada também proporciona aos colaboradores as chances de aumentar os ganhos através da economia colaborativa. Os equipamentos elétricos alugados em locais públicos, por serem gerenciados pela "Energia Compartilhada", têm uma gestão mais padronizada, tornando a utilização dos equipamentos elétricos mais prática. Obtendo ótimos resultados e consequentemente ganhando a confiança de muitos usuários. </p>\n                <img style="width: 100%; height: auto" src="'.concat(a("73f7"),'" alt="">\n                <p>O uso dos equipamentos elétricos hoje em dia já é comum. Sendo assim,  carregamos o intuito de aumentar a quantidade de equipamentos elétricos em mais áreas e locais públicos em um futuro próximo, e também devido a COVID -19, muitas pessoas estão enfrentando desemprego.   Considerando esse cenário,  a " Energia Compartilhada" permite  que mais pessoas façam parte deste  projetos e  obtenham lucro.</p>\n                <p>Faça parte da equipe e alcance liberdade financeira também!</p>\n                <p>A fim de permitir que mais pessoas conheçam este projeto do qual todas as pessoas podem participar, "Energia Compartilhada " tem um novo sistema de indicações e bônus, para que mais pessoas possam ser beneficiadas. </p>\n                <img style="width: 100%; height: auto" src="').concat(a("46dd"),'" alt="">\n                ')},{title:'Uma carta dedicada aos usuários da "Energia Compartilhada"!',img:a("13da"),time:"13.12.2020",id:"2",content:'\n            <h4 class="title">Uma carta dedicada aos usuários da "Energia Compartilhada"!</h4>\n            <p>Aos queridos usuários da "Energia Compartilhada":</p>\n            <p>Ano 2020/2021, devido ao avanço drástico da pandemia (Covid-19), causou um impacto inimaginável nas economias mundiais. Os resultados?  Inúmeras indústrias de manufaturas e lojas físicas no mundo inteiro estão declarando decadência ou até mesmo falência, deixando inúmeras pessoas desempregadas, as consequências de tudo isso é perda de renda familiar. Causando uma tragédia sem volta. Não é exagero dizer que a pandemia causou mais perdas no mundo do que a Segunda Guerra Mundial, e sem mencionar que ainda não estamos imunes ao vírus. Portanto, para que tenhamos uma vida melhor, é de extrema importância que a economia volte ao normal e as pessoas passem a obter rendas. </p>\n            <img style="width: 100%; height: auto" src="'.concat(a("0778"),'" alt="">\n            <p>Deparando com um cenário desses , os países do mundo estão criando estratégias para estimular a recuperação econômica. O projeto de energia renovável tem desempenhado um papel importante na recuperação econômica. Afinal, isso não só traz comodidade e proteção ambiental para as pessoas, mas também traz renda estável para as pessoas que participam do projeto, ganhando credibilidade no mundo todo!</p>\n            <img style="width: 100%; height: auto" src="').concat(a("3b29"),'" alt="">\n            <p>Com o objetivo de acelerar desenvolvimento do projeto da Energia Compartilhada, disponibilizamos a aquisição dos  equipamentos elétricos. Os usuários da plataforma Energia Compartilhada  além de adquirir os bônus através do aluguel dos dispositivos,  também podem optar por filiar-se à empresa, tornar-se membro da empresa. Este é o benefício de promover a economia colaborativa. Também é possível aumentar a renda participando de atividades nas plataformas, e alcançando a tão almejada liberdade financeira. Os números de colaboradores estão aumentando cada vez mais rápido e as oportunidades estão sempre reservadas para aqueles que estão preparados. Junte-se a nós e torne sua vida cada vez melhor!</p>\n            <img style="width: 100%; height: auto" src="').concat(a("6ade"),'" alt="">\n            ')},{title:'"Energia compartilhada" fornece equipamentos de carregamento para veículos elétricos no mundo.',img:a("3f50"),time:"2.7.2020",id:"3",content:'\n            <h4 class="title">"Energia compartilhada" fornece equipamentos de carregamento para veículos elétricos no mundo.</h4>\n            <p>Com o sucesso da venda da série Terra, o novo Terra 184 de 180kW que utiliza  o carregador compacto de alta potência com a maior densidade de potência do mercado.</p>\n            <p>De acordo com as Nações Unidas, as cidades são responsáveis por mais de 60% das emissões globais de gases de efeito estufa. Estima-se que, em 2050, as cidades abrigarão mais de dois terços da população mundial.</p>\n            <p>Portanto, é importante mencionar que devemos tomar medidas para que os centros urbanos em expansão reduzam as emissões de carbono, e os veículos elétricos são os fatores chave para atingir esse objetivo. No entanto, para que os veículos elétricos se tornem um meio de transporte  viáveis em cidades grandes, é necessário desenvolver soluções para atender a esses desafios.</p>\n            <img style="width: 100%; height: auto" src="'.concat(a("8afd"),'" alt="">\n            <p>Os mais recentes desenvolvimentos da ABB em tecnologia de carregamento são exatamente assim. O carregador Terra 184 é o mais recente membro da série Terra de carregadores mais vendida da ABB. É rápido, compacto e robusto. Pode carregar até três carros ao mesmo tempo, maximizando a conveniência para os motoristas e gerando receita para os operadores de carregamento.</p>\n            <p>A ABB se torna um modelo de referência  excelente quando se trata de assuntos de automóveis elétricos. A bateria Terra 184 por ser veloz, compacto e  potente, fez com que se tornasse o modelo mais vendido da ABB. Pode carregar até três carros ao mesmo tempo, maximizando a conveniência para os motoristas e gerando lucro para os colaboradores que adquiriram o equipamento.</p>\n            <p>O Terra 184 tem uma potência de carregamento de 180 kW e pode ser usado em veículos de vários tamanhos, tanto nos carros da última geração quanto dos carros da geração antiga, até mesmo nos ônibus ou caminhões. Mas, ao contrário de outros carregadores de alta potência, ele cobre uma área de menos de 0,5 metros quadrados, o mesmo que o modelo Terra 54.  Seu design inovador comprovou  que não há necessidade de instalar um gabinete elétrico separado, proporcionando uma solução rápida, compacta e perfeita para cidades com espaço limitado.</p>\n            <p>"Nos últimos dez anos, a ABB estabeleceu a base para o futuro do transporte sustentável. Frank Muehlon, chefe das operações globais da ABB, afirma:" Com a rápida expansão do Planeta, estamos atendendo às necessidades do dias de hoje e pensando em um futuro melhor,  incluímos nos centros  urbanos  a demanda por veículos elétricos que circulam com frequência." Criando soluções de infraestrutura de transporte elétrico.</p>\n            <p>Terra 184 adapta-se a  todos os padrões de baterias do mercado, incluindo CCS, CHAdeMO e AC, atende a todos os requisitos de bateria de até 920V.</p>\n            <p>Para aumentar a flexibilidade, os operadores de outros modelos Terra, como Terra 94 e 124, podem optar no futuro atualizar as funções da bateria  atual para bateria Terra 184. </p>\n            <img style="width: 100%; height: auto" src="').concat(a("c835"),'" alt="">\n            <p>A ABB obteve a licença da Terra 184 e estará disponível por meio de revendedores selecionados da ABB na Europa em julho, em agosto na América do Norte e pelo resto do mundo no quarto trimestre deste ano. Ele fornece uma solução de carregamento segura, inteligente e sustentável que apoia o "Projeto Carbono-Zero", que consiste em alcançar uma visão realista de redução das  emissões de gases de efeito estufa.</p>\n            <p>A ABB está há mais de 10 anos no mercado de baterias de veículos elétricos e tem experiência abrangedora no desenvolvimento de soluções de transporte sustentáveis. A ABB vendeu mais de 14.000 baterias DC da ABB em mais de 80 países, obtendo  recentemente o Prêmio Global de Líder de Veículos Elétricos em 2019 por seu papel no apoio à adoção internacional de soluções de transporte sustentável.</p>\n            <p>A ABB está há mais de 10 anos no mercado de baterias de veículos elétricos e tem experiência abrangedora no desenvolvimento de soluções de transporte sustentáveis. A ABB vendeu mais de 14.000 baterias DC da ABB em mais de 80 países, obtendo  recentemente o Prêmio Global de Líder de Veículos Elétricos em 2019 por seu papel no apoio à adoção internacional de soluções de transporte sustentável.</p>\n            <p>Acesse: <a href="www.abb.com">www.abb.com</a> para mais informações. </p>\n            <img style="width: 100%; height: auto" src="').concat(a("8110"),'" alt="">\n            ')},{title:"Nossa Historia!",img:a("2937"),time:"6.5.2018",id:"4",content:'\n            <h4 class="title">Nossa Historia!</h4>\n            <p>A Energia Compartilhada visa oferecer uma solução para as pessoas que enfrentam os problemas de recarga dos seus dispositivos eletrônicos. Hoje em dia o uso frequente dos celulares faz com que a bateria acabe rapidamente e estamos cansados de colocar o cabo de carregador em nosso bolso à procura de uma tomada na parede apenas para recarregar o máximo de energia possível. Portanto pensamos em algo simples, prático e acessível, e não estamos mencionando os carregadores portáteis nas quais temos que nos lembrar de carregá-las e levá-las conosco. E assim surgiu o projeto "Energia Compartilhada".</p>\n            <p>Autoatendimento nas estações de recarga dos celulares  e totalmente automatizados oferecem aos usuários que adaptam a qualquer modelo de smartphones, em qualquer lugar a qualquer momento. Liberdade total! </p>\n            <img style="width: 100%; height: auto" src="'.concat(a("b695"),'" alt="">\n            ')}]}function s(){return[{id:1,title:"Faça parte da Era da economia colaborativa Tornando a sua vida melhor!",content:'\n            <img style="width: 100%; height: auto" src="'.concat(a("e0be"),'" alt="">\n            <p style="color: #e54d42; font-weight: 700;">Parte 1: ALUGUEL DOS EQUIPAMENTOS</p>\n            <img style="width: 100%; height: auto" data-index="0" src="').concat(a("c371"),'" alt="">\n            <p style="color: #e54d42;">Observações:</p>\n            <p>1. O período do cancelamento dos equipamentos é considerado a partir do dia seguinte ao realizar a compra do equipamento, o cancelamento pode ser feito no dia seguinte.  A partir do momento que o usuário cancelar o equipamento, precisa estar ciente de que os ganhos também serão cancelados.</p>\n            <p>2. Os equipamentos terão custos de instalação, manutenção, gerenciamento, custos de transferência dos equipamentos e entre outros. Portanto, se você cancelar o equipamento antes do período da remuneração,  perderá os ganhos adquiridos.  Ao retornar os equipamentos serão descontados diretamente dos saques já realizados, mas o valor da cobrança não excederá 10% do valor dos equipamentos.</p>\n            <p>3. Após o equipamento atingir o período da colheita, o sistema irá retomar automaticamente os equipamentos, e o usuário não poderá cancelar o equipamento, mas os ganhos dos equipamentos permanecerão inalterados e ainda lhe trará ganho diariamente. Se o usuário desejar recolher os equipamentos por conta própria após o período da colheita, você pode retirá-lo na empresa ou receber através do correio (taxa de frete não está incluso), os ganhos serão interrompidos na data em que o usuário solicitar o retorno porém os ganhos  gerados anteriormente pertencerá ao usuário. </p>\n            <p style="color: #e54d42;">Instruções:</p>\n            <p style="font-weight: 700;">Equipamento para teste（Contém 1 carregador portátil）</p>\n            <p>A taxa para aquisição é de R$ 200,  obtendo lucro diário de R$ 5 e lucro mensal de R$ 150. </p>\n            <p style="font-weight: 700;">Equipamentos de porte pequeno (Contém 6 carregadores portáteis)</p>\n            <p>A taxa para aquisição é de R$ 1,500,  obtendo lucro diário de R$ 26 e lucro mensal de R$ 780. </p>\n            <p style="font-weight: 700;">Equipamentos de porte médio (Contém 9 carregadores portáteis)</p>\n            <p>A taxa para aquisição é de R$ 3,500,  obtendo lucro diário de R$ 60 e lucro mensal de R$ 1,800. </p>\n            <p style="font-weight: 700;">Equipamentos de porte grande (Contém 12 carregadores portáteis)</p>\n            <p>A taxa para aquisição é de R$ 4,800  obtendo lucro diário de R$ 86 e lucro mensal de R$ 2,580. </p>\n            <p style="font-weight: 700;">Posto de recarga de porte pequeno（Contém 1 entrada de tomada）</p>\n            <p>A taxa para aquisição é de R$ 15,000,  obtendo lucro diário de R$ 214 e lucro mensal de R$ 6,420. </p>\n            <img style="width: 100%; height: auto" src="').concat(a("1c80"),'" alt="">\n            <p style="color: #e54d42; font-weight: 700;">Parte 2: COMISSÃO POR INDICAÇÃO DOS EQUIPAMENTOS</p>\n            <img style="width: 100%; height: auto" data-index="1" src="').concat(a("bf452"),'" alt="">\n            <p style="color: #e54d42;">Instruções:</p>\n            <p>Após adquirir qualquer equipamento, o usuário poderá indicar seus amigos a adquirir o equipamento. A aquisição de qualquer equipamento pelos membros dos três níveis, o usuário receberá um valor da comissão correspondente à taxa de aquisição dos membros dos  três níveis."COMISSÃO POR INDICAÇÃO DOS EQUIPAMENTOS" o usuário apenas terá um ganho.</p>\n            <p style="color: #e54d42;">Exemplo:</p>\n            <p>O amigo A adquiriu  um equipamento de R$ 1,500, o usuário receberá  4% da comissão : R$ 60; o amigo A indicou o amigo B para adquirir um equipamento de R$ 1,500, o usuário poderá receber 3% da comissão: R$ 45; o amigo B indicou um amigo C para adquirir um equipamento de R$ 1,500 reais, portanto o usuário poderá  receber 2% da comissão: R$ 30.</p>\n            <p style="color: #e54d42; font-weight: 700;">PARTE 3: COMISSÃO DOS EQUIPAMENTOS POR REDE</p>\n            <img style="width: 100%; height: auto" data-index="2" src="').concat(a("3b9f"),'" alt="">\n            <p style="color: #e54d42;">Instruções:</p>\n            <p>Além do usuário obter ganhos através dos aluguéis  dos  equipamentos e por indicações, também  poderá obter comissões diárias através dos ganhos gerados pelos membros da própria rede.</p>\n            <p style="color: #e54d42;">Exemplo: </p>\n            <p style="font-weight: 700;">Você indicou o amigo A para adquirir o equipamento, A é o membro do 1º nível ; A indica o amigo B para adquirir o equipamento, B é o membro do 2º nível ; B indica o amigo C para adquirir os equipamentos, C é o membro do 3º de nível ; C indica o amigo D para adquirir o equipamento, D é membro do 4º nível; D indica o amigo E para adquirir o equipamento, E é o membro do  5º nível. Essas redes podem lhe trazer muitos ganhos diariamente!</p>\n            <img style="width: 100%; height: auto" data-index="3" src="').concat(a("3093"),'" alt="">\n            <p style="color: #e54d42;">Exemplo: </p>\n            <p>No seu 1º nível tem 5 membros e cada um deles indicou mais 5 pessoas. Eles são seus membros do 2º nível e assim por diante, todos os membros de cada nível indicam mais  5 pessoas até o 5º nível, sua rede terá no total cinco níveis, com total de 3,905 pessoas. Se todos os membros adquirirem equipamentos de R$ 1,500 gerando lucro diário R$ 26, então a comissão gerada através dos equipamentos da sua rede é de R$ 1,032,2 diários. </p>\n            <p style="color: #e54d42; font-weight: 700;">Três segmentos de ganhos permitindo que você gere lucros de forma estável, rápida e fácil</p>\n            <img style="width: 100%; height: auto" data-index="4" src="').concat(a("861e"),'" alt="">\n            <p style="color: #e54d42;">Exemplo:</p>\n            <p style="font-weight: 700;">Você adquiriu um equipamento de R$ 1,500, e desenvolveu uma rede de 5 níveis, todos os membros adquiriram um equipamento de R$ 1,500, somando os 3 segmentos de ganhos, o seu lucro diário é de R$ 1,058.2 ( comissão por indicação dos equipamentos não está incluso), e lucro mensal é de  R$ 36,921 ( comissão por indicação dos equipamentos não está incluso).</p>\n            <p style="color: #e54d42;">Portanto, quanto mais indicações, maior a sua rede. Você e seus amigos podem gerar ganhos de uma forma estável, rápida e acessível. </p>\n            ')},{id:2,title:"A Era da Geração Compartilhada está dando início. Junte-se a nós e torne a sua vida ainda melhor! ",content:'\n            <img style="width: 100%; height: auto" src="'.concat(a("a938"),'" alt="">\n            <p style="font-weight: 700;">1.  O que é Geração de energia compartilhada? </p>\n            <p>A "Energia Compartilhada" é uma plataforma de serviço virtual, fundada no ano de 2017, com sede na Califórnia, Estados Unidos, localizada na rua Waterfront Drive, Playa Vista, 12045 E. Somos uma empresa que fornece serviços para as redes de carregadores portáteis, como ABB, Jiffy, CoCharge, Plugo, Naki Power e entre outras.</p>\n            <p>Possuímos clientes ao redor do mundo, além do profissionalismo e dedicação, a empresa vem contribuindo com os serviços em mais de 25 idiomas, com uma equipe de pessoas que vêm de 20 países diferentes e extremamente capacitados. </p>\n            <p>Em 2019, obtivemos um Venture Capital ou Capital de risco da NASDAQ-TSLA, no valor de 50 milhões de Dólares.</p>\n            <p>Com os surgimentos dos produtos eletrônicos, como telefones celulares, notebooks e carros elétricos, estão fazendo com que a fonte da energia compartilhada se torne uma tendência global no futuro. </p>\n            <p style="font-weight: 700;">2. A visão da "Energia Compartilhada"</p>\n            <p>O Mundo está se desenvolvendo rapidamente para a economia colaborativa e projetos de energia renováveis.</p>\n            <p>O carregador portátil está se tornando um item indispensável para aquelas que ficam o dia todo fora ou passam a maioria do tempo viajando, esses dispositivos  poderão ser vistos em locais públicos, como estações de aeroporto, pontos turísticos, restaurantes, bares, cafés e shoppings. As pessoas conseguem alugar os dispositivos para realizar a recarga dos  seus telefones celulares, laptops e outros dispositivos eletrônicos a qualquer momento do dia. </p>\n            <p style="font-weight: 700;">3. Qualquer pessoa consegue aumentar os seus ganhos através da "Energia Compartilhada"? </p>\n            <p>Exatamente, a "Energia Compartilhada" adota o método  de economia colaborativa  ao público e ao mercado global. Seguindo os protocolos da proteção ambiental do governo e gerenciando a padronização dos carregadores que podem ser vistos em todos os lugares,  fornecemos aos nossos colaboradores a distribuição de bens dos serviços adquiridos. Os nossos parceiros poderão aumentar os seus ganhos uma vez adquirindo os equipamentos e sendo utilizados pelas pessoas em locais públicos.</p>\n            <p style="font-weight: 700;">4. Quais são os requisitos para tornar-se um colaborador?</p>\n            <p>Atualmente existem 5 variedades de equipamentos de fonte de energia na plataforma "Energia Compartilhada", cada um com uma quantidade de aquisição limitada. Conforme vão alterando as funções dos equipamentos, o valor de cada um deles também varia. Sendo assim o valor da garantia também varia de modelo para modelo. Você pode solicitar o equipamento no nosso aplicativo "Energia Compartilhada" para obter os benefícios.</p>\n            <p style="font-weight: 700;">5. Os lucros da obtenção dos dispositivos são permanentes? O depósito será reembolsado?</p>\n            <p>Após adquirir o dispositivo, você poderá obter a renda correspondente diariamente e permanente. Se desejar cancelar a inscrição, é só retornar o dispositivo a qualquer momento, a plataforma reembolsará  o depósito do dispositivo correspondente e os lucros gerados pelo dispositivo serão encerrados com o cancelamento.</p>\n            <p style="font-weight: 700;">6. Como realizar o saque após a assinatura?</p>\n            <p>Preencha os seus dados pessoais e a conta do cartão bancário na nossa plataforma "Energia Compartilhada" para facilitar as transferências bancárias.</p>\n            <p style="font-weight: 700;">7. Além dos ganhos diários, a plataforma contribui com outro tipo de bônus?</p>\n            <p>Sim, o nosso propósito é fazer com que o usuário tenha mais interação com o nosso modelo de economia colaborativa, os colaboradores podem receber prêmios através dos dispositivos, indicação, desenvolvimento da equipe e realizando login na plataforma da "Energia Compartilhada" participando dos eventos e concorrendo a prêmios.</p>\n            <p style="font-weight: 700;">8. Quanto tempo leva para realizar o saque?</p>\n            <p>Após o usuário solicitar saque na plataforma, notificamos imediatamente o banco conforme informado pelo colaborador na nossa plataforma para efetuar o pagamento. O saque ficará disponível em 24 horas. </p>\n            <p style="font-weight: 700;">9. Por que é necessário  pagar pela tarifa de saque?</p>\n            <p>A empresa deverá pagar impostos ao governo, aos bancos cooperativos e hosting da nossa plataforma. </p>\n            <img style="width: 100%; height: auto" src="').concat(a("c65c"),'" alt="">\n            ')}]}},"13da":function(e,o,a){e.exports=a.p+"static/img/news02.ccfe0627.png"},"1c80":function(e,o,a){e.exports=a.p+"static/img/company03.b1b9e826.jpg"},"291c":function(e,o,a){"use strict";var t=a("50fd"),s=a("0033"),r=a("26d6");e.exports=function(e,o,a){var n=t(o);n in e?s.f(e,n,r(0,a)):e[n]=a}},2937:function(e,o,a){e.exports=a.p+"static/img/news04.6bd51155.jpg"},3093:function(e,o,a){e.exports=a.p+"static/img/companyBx06.b07a3ab3.png"},"3b29":function(e,o,a){e.exports=a.p+"static/img/detail04.feb5d8e2.jpg"},"3b9f":function(e,o,a){e.exports=a.p+"static/img/companyBx05.78bd543d.png"},"3f50":function(e,o,a){e.exports=a.p+"static/img/news03.d78a8468.jpg"},"46dd":function(e,o,a){e.exports=a.p+"static/img/detail02.5c413875.jpg"},"47b0":function(e,o,a){"use strict";var t=a("0c99"),s=a("18c7"),r=a("79b4"),n=a("cdc4"),i=a("86c4"),d=a("ca91"),c=a("291c"),p=a("5b79"),l=a("036c"),m=a("4238"),u=a("a90f"),h=m("isConcatSpreadable"),g=9007199254740991,f="Maximum allowed index exceeded",b=u>=51||!s((function(){var e=[];return e[h]=!1,e.concat()[0]!==e})),y=l("concat"),v=function(e){if(!n(e))return!1;var o=e[h];return void 0!==o?!!o:r(e)},w=!b||!y;t({target:"Array",proto:!0,forced:w},{concat:function(e){var o,a,t,s,r,n=i(this),l=p(n,0),m=0;for(o=-1,t=arguments.length;o<t;o++)if(r=-1===o?n:arguments[o],v(r)){if(s=d(r.length),m+s>g)throw TypeError(f);for(a=0;a<s;a++,m++)a in r&&c(l,m,r[a])}else{if(m>=g)throw TypeError(f);c(l,m++,r)}return l.length=m,l}})},"5b79":function(e,o,a){var t=a("cdc4"),s=a("79b4"),r=a("4238"),n=r("species");e.exports=function(e,o){var a;return s(e)&&(a=e.constructor,"function"!=typeof a||a!==Array&&!s(a.prototype)?t(a)&&(a=a[n],null===a&&(a=void 0)):a=void 0),new(void 0===a?Array:a)(0===o?0:o)}},"6ade":function(e,o,a){e.exports=a.p+"static/img/detail05.e91167f8.jpg"},"71e5":function(e,o,a){e.exports=a.p+"static/img/news01.0f57c765.png"},"73f7":function(e,o,a){e.exports=a.p+"static/img/detail01.40e4ff22.jpg"},"79b4":function(e,o,a){var t=a("c4b4");e.exports=Array.isArray||function(e){return"Array"==t(e)}},"7c49":function(e,o,a){e.exports=a.p+"static/img/company07.2bb536f4.png"},"7c58":function(e,o,a){"use strict";a.d(o,"b",(function(){return t})),a.d(o,"a",(function(){return s}));a("47b0");function t(){return[{title:"Shared Energy new recommendation and reward system",img:a("71e5"),time:"29.3.2021",id:"1",detailImg1:a("73f7"),content:'\n                <h4 class="title">Join "Shared Energy" to get more income opportunities</h4>\n                <p>In the past two years, many countries and regions have actively promoted the rapid development of sharing economy and new energy projects. "Shared Energy" not only brings convenience to many people’s lives, but also providing people with A lot of employment opportunities have also allowed people participating in sharing economy projects to obtain a very good income,thus improving their lives. The power equipment rented in public places also has more standardized management because of our "Shared Energy", which makes it more convenient for people who use power equipment.  This project has also been highly appreciated by Many people!</p>\n                <img style="width: 100%; height: auto" src="'.concat(a("73f7"),'" alt="">\n                <p>With the widespread use of power equipment, more and more people use it. We will put power equipment in more areas and public places in the future to increase the number of power equipment. Let more people participate in shared power projects to earn income, because the COVID-19 problem has caused many people to lose their jobs. Joining the Internet to work has also become a source of income for people.</p>\n                <p>In order to let more people know about this work that all people can participate in, "Shared Energy" has formulated a new recommendation and reward system, so that more people can get more income.</p>\n                <img style="width: 100%; height: auto" src="').concat(a("46dd"),'" alt="">\n                ')},{title:"A letter to users of Shared Energy platform！",img:a("13da"),time:"13.12.2020",id:"2",content:'\n            <h4 class="title">A letter to users of “Shared Energy”platform！</h4>\n            <p>2020~2021. Due to the spread of (covid-19) on a global scale, it has caused immeasurable economic losses to all countries in the world. It has caused countless manufacturing industries and physical stores around the world to announce the closure or even bankruptcy, leaving countless people out of work. Also terminated the source of income for each family. And it brought disaster. It is no exaggeration to say that (covid-19) has caused more losses to the world than the Second World War, and the whole world is not immune. This time (covid-19) everyone understands that if there is a side job to increase income, maybe life will not be so bad.</p>\n            <img style="width: 100%; height: auto" src="'.concat(a("0778"),'" alt="">\n            <p>At present, all countries in the world are stimulating domestic economic recovery with various policies and benefits. Shared power projects have played a vital role in economic recovery. After all, this not only brings convenience and environmental protection to the people, but also brings a stable income to the people participating in the project, so it has also won the unanimous praise of the people!</p>\n            <img style="width: 100%; height: auto" src="').concat(a("3b29"),'" alt="">\n            <p>In order to accelerate the rapid development of shared power projects, we have now opened up subscriptions for power equipment. Users of shared energy platforms can not only subscribe to the equipment to collect daily rent, but also choose to join the company and become a member of the company to receive salary and promote The benefits of the sharing economy. It is also possible to increase income by participating in the welfare activities of the platform, thereby achieving wealth freedom. The number of participants is growing rapidly, and opportunities will always be reserved for those who are prepared. Join us and make your life better and better!</p>\n            <img style="width: 100%; height: auto" src="').concat(a("6ade"),'" alt="">\n            ')},{title:"Shared Energy provides charging equipment for the world's new electric cars",img:a("3f50"),time:"2.7.2020",id:"3",content:'\n            <h4 class="title">"Shared Energy" provides charging equipment for the world\'s new electric cars</h4>\n            <p>An extension of the best-selling Terra range, the new 180kW Terra 184 is the most compact high-power charger with the highest power density on the market</p>\n            <p>According to the UN, cities are responsible for more than 60 percent of global greenhouse gas emissions1 and by 2050 are expected to be home to more than two thirds of the world’s population2.</p>\n            <p>It is, therefore, vital that these rapidly expanding urban hubs take proactive steps to reduce their carbon emissions and e-mobility is a key factor in achieving this. But for e-mobility to be viable in high density cities, where time is short and space is at a premium, solutions must be developed which address these challenges.</p>\n            <img style="width: 100%; height: auto" src="'.concat(a("8afd"),'" alt="">\n            <p>ABB’s latest evolution in charging technology does just that. The Terra 184 charger, the latest member of ABB’s best-selling Terra family of chargers, is fast, compact, robust and provides the ability to charge up to three vehicles simultaneously3, maximizing convenience for drivers and revenue for the charging operator.</p>\n            <p>With a charging power of 180kW, the Terra 184 can be used by vehicles of all sizes, be it latest or future generation private cars, buses or trucks. But unlike other high-power chargers, it comes with a footprint of less than 0.5m2, the same as the current Terra 54 model. Indeed, its innovative design means there is no need for separately installed power cabinets, offering the perfect fast and compact solution for cities with limited space.</p>\n            <p>“Over the last decade, ABB has laid the foundation for the future of sustainable transportation. With our latest extension to the Terra range, we have delivered against the demands of today and tomorrow, both in terms of the needs of urban areas and of the electric vehicles which frequent their roads,” said Frank Muehlon, Head of ABB’s global business for E-mobility Infrastructure Solutions.</p>\n            <p>The Terra 184 supports all the charging standards on the market, including CCS, CHAdeMO and AC, and caters to the needs of all batteries up to 920V. It is highly customizable with features including customized credit card payment terminal, screen and cables, which have also been designed at 8 meters for maximum charging convenience.</p>\n            <p>For added flexibility, operators of other Terra models such as the Terra 94 or 124, can in the future chose to upgrade their charging solution to the Terra 184 with the addition of extra power modules.</p>\n            <img style="width: 100%; height: auto" src="').concat(a("c835"),'" alt="">\n            <p>The Terra 184 will be available direct from ABB and via selected ABB distributors in Europe from July, North America from August and the rest of the world by the fourth quarter of this year. It offers a safe, smart and sustainable charging solution which supports ABB Electrification’s Mission to Zero, a vision for a zero-emission reality for all.</p>\n            <p>ABB has unrivalled expertise in developing sustainable transport solutions. Since entering the EV-charging market a decade ago, ABB has sold more than 14,000 ABB DC fast chargers across more than 80 countries. ABB recently received the Global E-mobility Leader 2019 award for its role in supporting the international adoption of sustainable transport solutions.</p>\n            <p>ABB(ABBN: SIX Swiss Ex) is a leading global technology company that energizes the transformation of society and industry to achieve a more productive, sustainable future. By connecting software to its electrification, robotics, automation and motion portfolio, ABB pushes the boundaries of technology to drive performance to new levels. With a history of excellence stretching back more than 130 years, ABB’s success is driven by about 110,000 talented employees in over 100 countries. <a href="www.abb.com">www.abb.com</a></p>\n            <img style="width: 100%; height: auto" src="').concat(a("8110"),'" alt="">\n            ')},{title:"Shared Energy' story!",img:a("2937"),time:"6.5.2018",id:"4",content:'\n            <h4 class="title">Shared Energy\' story!</h4>\n            <p>Shared Energy was created to solve the problem of on-the-go charging for smartphone users all over the world. Our phones were constantly running low on power, and we had been frustrated by the existing solutions out there. We got tired of carrying our charging cords in our pants pocket and searching for a wall outlet, or being tethered to a charging pole just to squeeze a little more juice into our phone batteries when we could. We also didn’t want to buy expensive external battery packs that we would have had to remember to charge and carry with us. We wanted something easy, affordable, and everywhere… so we built it.</p>\n            <p>Shared Energy\' self-service, fully automated kiosks give smartphone users power where they need it—on-the-go and in their hands. No cords, no stopping, no problem.</p>\n            <img style="width: 100%; height: auto" src="'.concat(a("b695"),'" alt="">\n            ')}]}function s(){return[{id:1,title:"The era of the global sharing economy has come, join us and make your life better!",content:'\n            <img style="width: 100%; height: auto" src="'.concat(a("e0be"),'" alt="">\n\n            <img style="width: 100%; height: auto" data-index="0" src="').concat(a("8996"),'" alt="">\n            <p style="color: #e54d42;">Explanation：</p>\n            <p style="font-weight: 700;">Experience Device：</p>\n            <p style="color: #e54d42;">Need to invest in 200R$ subscription， you can have 12 hours of income perday， each hour can earn 0.6R$，daily income is 7.2R$， and monthly income is 216R$.</p>\n            <p>The subscription period is 1 day, and the subscription can be cancelled when it expires, and the deposit of the subscription equipment will be refunded.</p>\n            <p style="font-weight: 700;">Medium Equipment：</p>\n            <p>Need to invest in 1800R$ subscription， you can have 12 hours of income perday， each hour can earn 5.5R$，daily income is 66R$， and monthly income is 1980R$.</p>\n            <p>The subscription period is 10 day, and the subscription can be cancelled when it expires, and the deposit of the subscription equipment will be refunded.</p>\n            <p style="font-weight: 700;">Large Equipment：</p>\n            <p>Need to invest in 5000R$ subscription， you can have 12 hours of income perday， each hour can earn 14.4R$，daily income is 172.8R$， and monthly income is 5184R$.</p>\n            <p>The subscription period is 25 day, and the subscription can be cancelled when it expires, and the deposit of the subscription equipment will be refunded.</p>\n            <p style="font-weight: 700;">Small Electric Car Charger：</p>\n            <p>Need to invest in 15000R$ subscription， you can have 12 hours of income perday， each hour can earn 50R$，daily income is 600R$， and monthly income is 18000R$.</p>\n            <p>The subscription period is 35 day, and the subscription can be cancelled when it expires, and the deposit of the subscription equipment will be refunded.</p>\n            <p style="font-weight: 700;">Underground Parking Charger：</p>\n            <p>Need to invest in 35000R$ subscription， you can have 12 hours of income perday， each hour can earn 110R$，daily income is 1320R$， and monthly income is 39600R$.</p>\n            <p>The subscription period is 35 day, and the subscription can be cancelled when it expires, and the deposit of the subscription equipment will be refunded.</p>\n            <p style="font-weight: 700;">Outdoor Parking Charger：</p>\n            <p>Need to invest in 60000R$ subscription， you can have 12 hours of income perday， each hour can earn 195R$，daily income is 2340R$， and monthly income is 70200R$.</p>\n            <p>The subscription period is 35 day, and the subscription can be cancelled when it expires, and the deposit of the subscription equipment will be refunded.</p>\n            <img style="width: 100%; height: auto" src="').concat(a("1c80"),'" alt="">\n            <img style="width: 100%; height: auto" data-index="1" src="').concat(a("a758"),'" alt="">\n            <p style="font-weight: 700;color: #e54d42;">Explanation：</p>\n            <p>Refer friends to subscribe to device rewards：</p>\n            <p>After you have a device， you can recommend a friend to subscribe to the device， and you can get a 10% referral reward from it after successful subscription.</p>\n            <p style="font-weight: 700;color: #e54d42;">for example：</p>\n            <p style="color: #e54d42;">You recommend that A successfully subscribes to a device with 60000R$， and the system will give you 6000R$ as a reward.The more devices subscribed，the more rewards will be.</p>\n            <img style="width: 100%; height: auto" data-index="2" src="').concat(a("d9bb"),'" alt="">\n            <p style="font-weight: 700;color: #e54d42;">Explanation：</p>\n            <p>Platform users can join the company and become a member of the company.Not only can they receive a salary， they can also get more daily income by developing their own team.</p>\n            <div><span style="font-weight: 700;color: #e54d42;">for example：</span><span style="color: #e54d42;">You invite friend A to register and successfully subscribe to the device, A is your first-level team.A invites friend B to register and successfully subscribes to the device, B is your second-level team.B invites friends C to register and successfully subscribe to the device, C is your third-level team, C invites friends D to register and successfully subscribe to the device, D is your fourth-level team, D invites friends E to register and successfully subscribe to the device, E is your fifth-level team, E invites friends F to register and successfully subscribe to the device, F is your sixth-level team. These teams can earn you a lot of income everyday!</span></div>\n            <img style="width: 100%; height: auto" data-index="3" src="').concat(a("bb15"),'" alt="">\n            <div><span style="font-weight: 700;color: #e54d42;">for example：</span><span>If you invite ten people to register and successfully subscribe to the device.Each of the ten people you recommend invites another ten people to register and successfully subscribe to the device.In addition， each of the ten people invited ten people to register and successfully subscribe to the device.Then your first-level team has a total of 10 people，your second-level team has a total of 100 people， and your third-level team has a total of 1000 people.</span></div>\n            <p style="color: #e54d42;">If each of them has a daily equipment rental income of 5000R$， then you can calculate your daily team income：</p>\n            <img style="width: 100%; height: auto" data-index="4" src="').concat(a("7c49"),'" alt="">\n            ')},{id:2,title:"The era of the global sharing economy has come, join us and make your life better!",content:'\n            <img style="width: 100%; height: auto" src="'.concat(a("a938"),'" alt="">\n            <p style="font-weight: 700;">1.What is"Shared Energy"?</p>\n            <p>"Shared Energy"is a network service platform，establishedi in 2017 and headquartered at 12045E.Waterfront Drive Playa Vista，CA 90094 USA，is network service provider for new energy chargers such as ABB， Jiffy， CoCharge， Plugo，Naki Power， etc. Serving customer sall over the world， with language environments in more than 25 countries，agents all over the world， and offices in more than 20 countries around the world.Professionalism and focus are users accurate evaluation of our "Shared Energy"! "Shared Energy" has successfully obtained Tesla\'s Broundl venture investment of 50 million US dollars in 2019. We are making the finall sprint for the Nasdaq listing.In the future，Sharedl power will become a global trend.In this era when mobile phones， laptops，electric cars and other power products are launched one after another， batteries are everything.We look forward to your joining.</p>\n            <p style="font-weight: 700;">2.The prospect of shared power projects?</p>\n            <p>The world is vigorously developing the sharing economy and new energy projects.Shared power bank can bring many conveniences and environment all protection to the people.</p>\n            <p>The penetration rate of power banks will be higher and higher.Now they can be seen everywhere in airports，large supermarkets， and public establishments. People can rent them to charge their mobile phones，laptops and other electronic devices anytime and anywhere.</p>\n            <p style="font-weight: 700;">3.Can everyone earn income by subscribing to devices on"Shared Energy"?</p>\n            <p>Yes， our"Shared Energy" is a network service platform that is open to the global market.In response to the government\'s environmental protection policy and more standardized management of chargers that can be seen everywhere，we will open the subscription quota for each mobile power supplly.And lease the subscribed equipment to public places to those in need， so that all users who successfully subscribed for the equipment in"Shared Energy"can get income.</p>\n            <p style="font-weight: 700;">4.What are the requirements for subscribing to a device?</p>\n            <p>Currently， there are 6 types of power supply devices on the"Shared Energy" platform，each of which has a very limited subscription quota， and the power and functions of each type of power supply device are allso very different. Since the rental income of each type of equipment is different， the securiity deposit for the subscription equipment is also different.The more devices you subscribe to， the more revenue you will earn.As long as you have legal personal information and a bankaccount， you can order devices on the"Shared Energy"APP to get revenue.</p>\n            <p style="font-weight: 700;">5.ls the subscription equipment revenue permanent?Will the deposit for the subscription be refunded?</p>\n            <p>When you successfully subscribe to the device，you can get the corresponding income everyday， and the income is permanent.When you don\'t need this device， you can cancel the subscription at anytime， the platform will pay you the corresponding device deposit， and your device income will be terminated with the cancellation ofthe subscription.</p>\n            <p style="font-weight: 700;">6.How can I withdraw money after subscribing to the device?</p>\n            <p>You need to complete your personal information and bankcard account on"Shared Energy"to facilitate bank transfers.</p>\n            <p style="font-weight: 700;">7.In addition to the daily equipment rental income， are there other rewards on the platform?</p>\n            <p>Yes，in order to allow users to better participate in the sharing economy projects， the government provides a variety of different types of rewards，that is， equipment rentall income，invite friends rewards，personall team income rewards， and "Shared Energy" on boarding.And join group activity rewards.</p>\n            <p style="font-weight: 700;">8.How long does it take for the withdrawal to arrive successfully?</p>\n            <p>After the user of the platform withdraws，we will immediately notify the contracted Bank to make the payment.Usually the bank takes 24 hours to process，please be patient!</p>\n            <p style="font-weight: 700;">9.Why dol need to pay a certain fee for withdrawal?</p>\n            <p>Company needs to pay taxes to the government and coopererative banks，andl need to pay a small fee to the pllat form.After all， the equipment rentall income is yours.Platform operation and equipment deployment also require costs， I hope you canunderstand.</p>\n            <img style="width: 100%; height: auto" src="').concat(a("c65c"),'" alt="">\n            ')}]}},8110:function(e,o,a){e.exports=a.p+"static/img/detail08.46e69f73.png"},"861e":function(e,o,a){e.exports=a.p+"static/img/companyBx07.2ca564c5.png"},8996:function(e,o,a){e.exports=a.p+"static/img/company02.0c958614.png"},"8afd":function(e,o,a){e.exports=a.p+"static/img/detail06.6e98234c.png"},a758:function(e,o,a){e.exports=a.p+"static/img/company04.49e13ee0.png"},a938:function(e,o,a){e.exports=a.p+"static/img/company08.bcc9f854.jpg"},b695:function(e,o,a){e.exports=a.p+"static/img/detail09.104c3438.png"},bb15:function(e,o,a){e.exports=a.p+"static/img/company06.05d3d2ac.jpg"},bf452:function(e,o,a){e.exports=a.p+"static/img/companyBx04.68b41632.png"},c371:function(e,o,a){e.exports=a.p+"static/img/companyBx02.d0bc40c0.png"},c65c:function(e,o,a){e.exports=a.p+"static/img/company09.0731b879.jpg"},c835:function(e,o,a){e.exports=a.p+"static/img/detail07.f9dd75ef.jpg"},d9bb:function(e,o,a){e.exports=a.p+"static/img/company05.f01149fc.png"},e0be:function(e,o,a){e.exports=a.p+"static/img/company01.f20f1abc.jpg"}}]);